double entropy(string& st)
{
	vector<char> stvec(st.begin(), st.end());
	set<char> alphabet(stvec.begin(), stvec.end());
	vector<double> freqs;
	for (set<char>::iterator c = alphabet.begin(); c != alphabet.end(); ++c) {
		int ctr = 0;
		for (vector<char>::iterator s = stvec.begin(); s != stvec.end(); ++s) {
			if (*s == *c) {
				++ctr;
			}
		}
		freqs.push_back((double)ctr / (double)stvec.size());
	}
	double ent = 0;
	double ln2 = log(2);
	for (vector<double>::iterator f = freqs.begin(); f != freqs.end(); ++f) {
		ent += *f * log(*f) / ln2;
	}
	ent = -ent;
	return ent;
}

double entropy(wstring& wst) // overload method for wstring
{
	string wsttmp(wst.begin(), wst.end());
	double ret = 0;
	ret = entropy(wsttmp);
	return ret;
}

wstring toloweranddeobfuscate(wstring& wst_passw)
{
	int i = 0;
	char c;
	int pwsize = wst_passw.size() + 1;
	wchar_t *wch_password = new wchar_t[pwsize];
	while (wst_passw[i])
	{
		c = wst_passw[i];
		// reverse leet speak and other common subs here
		switch (c)
		{
		case '0': c = 'o'; break;
		case '1': c = 'l'; break;
		case '2': c = 'z'; break;
		case '3': c = 'e'; break;
		case '4': c = 'a'; break;
		case '5': c = 's'; break;
		case '6': c = 'd'; break;
		case '7': c = 't'; break;
		case '8': c = 'b'; break;
		case '9': c = 'g'; break;
		case '$': c = 's'; break;
		case '!': c = 'i'; break;
		case '(': c = 'c'; break;
		case '#': c = 'f'; break;
		case '<': c = 'k'; break;
		case '+': c = 't'; break;
		case '>': c = 'v'; break;
		case '%': c = 'x'; break;
		case '?': c = 'y'; break;
		case '@': c = 'a'; break;
		default:
			break;
		}
		wch_password[i] = tolower(c);  // putchar(tolower(c));
		i++;
	}
	wch_password[i] = '\0'; // add null
	wstring ret = wch_password;
	return ret;
}


