// Exported function
// -----------------
// This function actually validates
// a new password.
// LSA calls this function when a password is assign to a new user
// or password is changed on exisiting user.
// 
// This function return TRUE is password meets requirements
// that filter checks; FALSE is password does NOT meet these requirements
//
// In our implementation, specified Regular Expression must match new password
BOOLEAN __stdcall PasswordFilter(
	PUNICODE_STRING AccountName,
	PUNICODE_STRING FullName,
	PUNICODE_STRING Password,
	BOOLEAN SetOperation
	)
{
	wstring wstrPassword(Password->Buffer, Password->Length / sizeof(wchar_t));
	bool bMatch = FALSE;

	//// Prepare iterator
	//wstring::const_iterator start = wstrPassword.begin();
	//wstring::const_iterator end = wstrPassword.end();

	//match_results<wstring::const_iterator> what;

	//// Validate password against regular expression
	//wregex wrePassword(DEFAULT_REGEX);
	////GetPasswordRegExFromRegistry(wrePassword);
	//bMatch = regex_match(start, end, what, wrePassword);
	char * pSystemRoot; // 22-12-16 V1.1
	pSystemRoot = getenv("systemroot"); // 22-12-16 V1.1

	double d_entropy = entropy(wstrPassword); // using wstring overload now
	wstring ws_deobpasswlc = toloweranddeobfuscate(wstrPassword); // get just lowercase here

	// do our checks here and set flags for messages/decisions later
	int matchedword = 0;
	//for each (wstring word in wordarray)
	//{
	string line; // 22-12-16 V1.1
	ifstream myfile(pSystemRoot + string("\\banned.dic")); // 22-12-16 V1.1
	//ifstream myfile("C:\\Windows\\banned.dic"); // 22-12-16 V1.1
	if (myfile.is_open()) // 22-12-16 V1.1
	{ // 22-12-16 V1.1
		while (getline(myfile, line)) // 22-12-16 V1.1
		{ // 22-12-16 V1.1
		  //cout << line << '\n'; // 22-12-16 V1.1
			wstring word(line.begin(), line.end()); // 22-12-16 V1.1
			if (ws_deobpasswlc.find(word) != std::string::npos)
			{
				if (ws_deobpasswlc.size() / 2 >= word.size())
				{
					// do nothing
				}
				else
				{
					matchedword++;
				}
			}
		} // 22-12-16 V1.1
	}
	if (matchedword == 0)
	{
		if (d_entropy > 3)
		{
			bMatch = TRUE;
		}
	}

	// Erase all temporary password data
	// for security reasons
	ws_deobpasswlc.replace(0, ws_deobpasswlc.length(), ws_deobpasswlc.length(), (wchar_t)'?');
	ws_deobpasswlc.erase();
	wstrPassword.replace(0, wstrPassword.length(), wstrPassword.length(), (wchar_t)'?');
	wstrPassword.erase();
	SecureZeroMemory(Password->Buffer, Password->Length);

	return bMatch;
}